import React from 'react'
import Props from './Props'
import house from '../Assets/house.png'

function HomeProps() {
  return (
    <div>
        <div>
            <Props image="../Assets/house.png" type='Duplex' price='500' title='Fully Furnished Duplex for Sale' location='Town campus, Uyo' region='Top Liked Houses' />
        </div>
    </div>
  )
}

export default HomeProps
